Verenigde Staten
Drama
114 minuten

geregisseerd door Alex Kurtzman
met Chris Pine, Elizabeth Banks en Olivia Wilde

Sam (Chris Pine), een snel pratende verkoper van in de twintig, ziet zijn laatste deal in het water vallen op de dag dat hij hoort dat zijn vader plotseling is overleden. Tegen zijn zin moet Sam naar huis, waar hij de erfenis van zijn vader moet regelen en opnieuw contact moet opnemen met zijn vervreemde familie. Dan ontdekt Sam een verrassend geheim dat zijn hele wereld op zijn kop zet: Hij heeft een 30-jarige zus Frankie (Elizabeth Banks) van wie hij nooit heeft geweten. Wanneer ze elkaar ontmoeten en hun relatie zich ontwikkelt, wordt Sam gedwongen om alles wat hij dacht te weten over zijn familie te overdenken en zijn eigen levenskeuzes te herzien



